import './Expenses.css'
import ExpenseItem from './ExpenseItem'

function Expenses(props)
{
    let finalDiv = "";

    for (let i=0; i<props.Expenses.length; i++)
    {
       finalDiv += <ExpenseItem title={props.expenses[1].title} amount = {props.expenses[1].amount} date={props.expenses[1].date}/>
    };

 return (

   <div>{finalDiv}</div>

 )
}

export default Expenses;
